            Assert.AreEqual("SQRDMLAH V0.4S, V31.4S, V0.4S", asm);
        }
        
        {
            var raw = SQRDMLAH(V30.T_4S, V31.T_4S, V0.T_4S);
            var instruction = Arm64Instruction.Decode(raw);
            Assert.AreEqual(Arm64InstructionId.SQRDMLAH_asimdsame2_only, instruction.Id);
            Assert.AreEqual(Arm64Mnemonic.SQRDMLAH, instruction.Mnemonic);
            var asm = instruction.ToString("H", null);
            Assert.AreEqual("SQRDMLAH V30.4S, V31.4S, V0.4S", asm);
        }
    }
